#include<stdio.h>
int main()
{
    char a[50],b[50];
    scanf("%s%s",a,b);
    int i,l1=0,l2=0;
    while(a[l1]!='\0')
    {
        l1++;
    }
    while(a[l2]!='\0')
    {
        l2++;
    }
    if(l1==l2)
    {
        int e=1;
        while(i<l1)
        {
            if(a[i]!=b[i])
            {
                e=0;
                break;
            }
            i++;
        }
        if(e==0)
        {
            printf("Not Equal");
        }
        else
        {
            printf("Equal");
        }
    }
    else
    {
        printf("Not equal");
    }
    return 0;
}
